import React, { useState, setState } from "react";
import ReactDOM from "react-dom";

function App() {
    const [element, setData] = useState({"store": []});

    function ping() {
        fetch('../api')
        .then(response => response.text())
        .then(data => {
            setData(data)
            });
    }

    ping()

    return (
        <div>
            <div>This page was served statically</ div>
            <div>{element.data}</div>
        </div>,
        document.getElementById('root')
    );
};

ReactDOM.render(App())
